import React from 'react';
import logo from './logo.svg';
import './App.css';
import Moyu from'./ApiGet';
import axios from 'axios';
functionv
axios.get("http://localhost:8000/products/products/1/").then((results) => {
  console.log(results.data);
  return(
      <h1>{results.data}</h1>
  )
});

function App() {
  return (

    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
        {Moyu}
        </p>
      </header>
    </div>
  );
}

export default App;
